func GenerateImportPkgPath(pathMap map[string]string) string {
	buf := bytes.NewBuffer(nil)
	buf.WriteString("import (\n")
	for shortcut, completePath := range pathMap {
		buf.WriteString(shortcut)
		buf.WriteString(" \"")
		buf.WriteString(completePath)
		buf.WriteByte('"')
		buf.WriteString("\n")
	}
	buf.WriteString(")")
	return buf.String()
}

